CREATE DEFINER=`cobrasnake`@`localhost` PROCEDURE `login_procedure`(
    IN p_username VARCHAR(255),
    IN p_password VARCHAR(255)
)
BEGIN
    DECLARE v_user_id INT;
    DECLARE v_hashed_password VARCHAR(255);
    DECLARE v_session_token VARCHAR(255);

    -- Obter a senha hash do usuário
    SELECT id, password INTO v_user_id, v_hashed_password
    FROM users
    WHERE username = p_username OR email = p_username
    LIMIT 1;

    -- Verificar a senha
    IF v_user_id IS NOT NULL AND v_hashed_password = SHA2(p_password, 256) THEN
        -- Criar um token de sessão
        SET v_session_token = UUID();

        -- Inserir a sessão no banco de dados
        VALUES (v_user_id, v_session_token, DATE_ADD(NOW(), INTERVAL 1 HOUR));

        -- Retornar o token de sessão
        SELECT 'Login successful' AS message, v_session_token AS session_token;
    ELSE
        -- Senha incorreta ou usuário não encontrado
        SELECT 'Invalid credentials' AS error_message;
    END IF;
END ;;
